// import logo from './logo.svg';

import React from 'react';
import AllCards from './AllCards';

import './card-master.scss';



export default class CardMaster extends React.Component {
  constructor(props) {
    super(props)
    this.heading = props.heading;
    this.className = props.className;
    this.children = props.children;
  }

  render() {
    return (
      <div className='card__master'>
        <h2 className="card__master--heading">Courses: Spring 2019</h2>
        {this.children}
      </div>
    )
  }
}
